export default class Banner extends Component {
  render() {
    return (
      <div className="banner">
        <div className="banner.bg">
          {/* <Image src={BANNER_IMG}></Image> */}
        </div>
        <div>
          <h1>Patrick Wamsley</h1>
          <br />
          <h3>500 Squat 286 Bench 600 Deadlift</h3>
